import React, {Component} from 'react';
// import {Link} from 'react-router-dom';
import Loader from "./Loader";
import Day from "./Day.js";

class Calendar extends Component {

    constructor() {
        super();
        this.state = {
            data: null,
            isLoading: false,
            error: null,
        };
    };

    render() {
        return (
            <div>
                <Day style={{width: "10%"}}></Day>
            </div>
            );
    }
}

export default Calendar;
